import React from 'react';
import '../../App.css';
import Entry1 from '../entries/entry1';
import Footer from '../Footer';

function componentDidMount() {
  window.scrollTo(0, 0)
}


export default function Services() {
  componentDidMount();
  return (
    <div>
    <Entry1/>
    <img style={{objectFit: 'cover',
      //  opacity: '0.2',
       height: '75%',
       width: "40%",
       position: 'fixed',
       zIndex: '12'}} 
       src="/images/sandiegopotato.jpg"/>
    {/* <Entry1/> */}
    <Footer />
    </div>
    );
  }
